import React from 'react'
// import GoogleLogo from '../assets/login-images/google-logo.png'

export default function FirstPage() {
  const GoogleLogo = require('../assets/login-images/google-logo.png');
  return (
    <>
        <h1>
            <img src={GoogleLogo} alt="google-logo" />
        </h1>
    </>
  )
}
